are:ZpusobJednani.are:Text:
Způsob jednání:
a) zastupování - společnost zastupuje, jejím jménem jedná předseda představenstva a v jeho nepřítomnosti místopředseda představenstva;
b) podepisování - členové představenstva se podepisují za společnost tak, že k firmě společnosti připojí svůj podpis s uvedením svého jména a funkce.
